import React, { Component } from "react";
import iconArrow from "../../../assets/images/ic_arrow.svg";
import "./Exchange.css";
class Exchange extends Component {
  render() {
    return (
      <div className="row">
        <div className="col-5">
          <div>Bạn gửi</div>
        </div>
        <div className="col-2">
          <img src="" alt="change" />
        </div>
        <div className="col-5">
          <div>Bạn sẽ nhận</div>
        </div>
      </div>
    );
  }
}
export default Exchange;
